&lt;p&gt;निम्न प्रश्न में एक कथन और उसके बाद दो तर्क I और II दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको तय करना है कि, निम्नलिखित तर्कों में से कौनसे तर्क सबल हैं और कौनसे तर्क दुर्बल हैं।&lt;/p&gt;

